import { View, Text } from "react-native";
import React from "react";

const Login = () => {
  return (
    <View className="h-full bg-white">
      <View className="h-full my-5 mx-5 flex-1  bg-white">
        <Text>Login</Text>
        <View className="my-5 mx-5 flex-1 h-14 bg-black"></View>
      </View>
    </View>
  );
};

export default Login;
